import { Row, Col, Card, Badge } from "react-bootstrap";

export default function SOPCard(props) {
    return (
        <Card>
            <Card.Header as="h4" className={props.headerClass}>
                {props.title}
            </Card.Header>
            <Card.Body
                className={
                    (props.bodyClass ? props.bodyClass : "") + " justify-content-center"
                }
            >
                <Row>
                    {props.expression.getSOPStrings().map((sop) => (
                        <>
                            <Col as="h5" className="d-flex d-none d-md-block  mb-2">
                                <Badge pill bg="primary">
                                    {sop}
                                </Badge>
                            </Col>
                        </>
                    ))}
                </Row>
            </Card.Body>
        </Card>
    );
}
